import React from 'react';
import SearchUp from '../elements/search_box';
import Menubar from '../elements/menubar';

class Home extends React.Component {
  render() {
    return(
      <div>
        <header id="header">
          <p id="logo">민법을 적용하는 법</p>
          <Menubar/>
          </header>
        <nav id="nav">&nbsp;</nav>
        <div id="section">
          <SearchUp/>
        </div>
        <aside id="aside">&nbsp;</aside>
        <footer></footer>
      </div>
    )
  }
}

export default Home
